      | 32257 -> { ItemTypeData.id= 32257; name= "Report R:081-9560"; published= true; description= "This data fragment was pulled from an RSS Radio Telescope. It appears to be just one part of a larger intelligence dossier. <br><br>“The Consulate is able to, of course, but I'm confident that the current situation won't escalate. Even still, we need to keep pushing for the location of the [unidentified encryption – string undecipherable] … the Angels have smelled Jovian involvement and are now throwing all kinds of ISK around to catch up to us. They will, eventually. Don't doubt it. I almost wish Boufin sold us out to them in the end, they'd realize there is nothing of value to them there and screw off. But then I guess anything we value, they'll want to lord over us too. I've noticed a few people of theirs are assigned to me too. I'll be taking slightly longer to get to our meetings as a result; I don't want to be leading them anywhere we don't want. <br><br>She asked to meet Boufin again today by the way, and again I had to explain the risks and make her promise to lie low. I'm not completely trusting that she will let me handle things. She needs to keep up her public appearances in court, not go off meeting Gallentean historians in secret. Her career would be over in a second if we got made, and I'd have serious problems of my own. <br><br>She's growing increasingly frustrated though, so we may have to look into some kind of arrangement. Surely we can set up a secure FTL line for them both? I know how to do it myself; I just need your clearance to proceed.”"; marketGroupId= None; groupId= 314; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
