      | 356625 -> { ItemTypeData.id= 356625; name= "'Neo' Sentinel A-I"; published= false; description= "The Sentinel dropsuit is a second-generation solution designed to withstand concentrated small arms fire and protect the wearer from the concussive, thermal, and impact forces of low-grade explosives. Additionally, its power-assisted exoskeleton facilitates usage of the heaviest caliber personal weapons.    Every vital area of the wearer is protected by 25mm of composite ceramic shell or high tensile steel plates, layered with impact absorbing, compressed carbon latticework. A secondary thermal dispersion membrane channels excess heat away from the point of contact, distributing it over a larger surface area and thereby lessening the potential damage. Superconductive veins of hybrid silver coat the outer layers and connect every piece of the armor to a grounding heat sink, dampening the harmful effects of direct fire electromagnetic weaponry.    Heavy frame dropsuits lack the mobility of lighter suits, but this trade-off results in a defensive system that defies standard infantry conventions. No other classification of personal armor can claim to be able to stand toe-to-toe with enemy vehicles and survive."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 356819 -> { ItemTypeData.id= 356819; name= "K-2 Nanohive"; published= false; description= "The nanohive is one of the most advanced pieces of battlefield technology to date, able to convert formatted matter from its limited internal stores and reorganize it into any kind of ammunition. When a soldier approaches, the nanohive receives an automated request from the Cortex Holographic Interface instructing swarms of self-replicating construction nanites to begin producing whatever type of ammunition that soldier requires.  The device itself is composed of three major parts: a composite carbon polymer shell, heavily shielded to prevent potentially disruptive ambient electronic interference; a low-level replicator assembly housing the initial seed swarm; and a C11 power core capable of producing class-one containment fields, confining the nanite swarm as it replicates to its maximum sustainable mass. There is, however, no central computer; each nanite is born with a complete set of instructions on how to create every known variety of ammunition round."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 35943 -> { ItemTypeData.id= 35943; name= "Standup Stasis Webifier I"; published= true; description= "The Standup Stasis Webifier is a propulsion jamming system that is designed to reduce the maximum speed of targeted ships by using micro energy streams to entangle the target and reduce its effective speed. This module has incredible range, however it may only be activated in short bursts separated by cooldown periods. The Stasis Webifier system may be installed as a module in Upwell technology structures.    Standup is a proprietary system that uses a Structure Autonomous Nanoassembly Device (Upwell) containing integrated template software, a nanoassembler array and sufficient nanomass to enable the construction of a variety of service modules, structure modules and structure rigs when inserted into the appropriate slots on a structure built with Upwell technology."; marketGroupId= Some(2213); groupId= 1441; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 4; value= 500.000000 }; { DogmaAttributeValueData.attributeId = 6; value= 3000.000000 }; { DogmaAttributeValueData.attributeId = 1544; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 40.000000 }; { DogmaAttributeValueData.attributeId = 1298; value= 1657.000000 }; { DogmaAttributeValueData.attributeId = 1299; value= 1404.000000 }; { DogmaAttributeValueData.attributeId = 1300; value= 1406.000000 }; { DogmaAttributeValueData.attributeId = 669; value= 60000.000000 }; { DogmaAttributeValueData.attributeId = 2334; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 4000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 50; value= 2500.000000 }; { DogmaAttributeValueData.attributeId = 30; value= 50000.000000 }; { DogmaAttributeValueData.attributeId = 54; value= 200000.000000 }; { DogmaAttributeValueData.attributeId = 73; value= 30000.0000