      | 4321 -> { ItemTypeData.id= 4321; name= "Research Abstract: Project Blueprint"; published= true; description= "<b>Paper:</b> Project Blueprint<br>  <b>Lead Researchers:</b> Adainy Gwanwyn, Emily Dallocort<br>  <b>Contributors:</b> Mark726<br>  <b>Summary:</b> The premise of Project Blueprint is to acquire photographic samples (along with standard documentation) of Sleeper constructs to determine their similarity, if any, to those produced in known space. Currently, researchers are in the initial phases of gathering samples of New Eden's structures to compare to the Sleeper constructs once wormhole excursions begin.    The purpose behind gathering this information is manifold:<br>     1. To investigate if Sleeper constructs hold any sort of cultural significance to the Sleepers themselves;<br>     2. To investigate if Sleepers build their constructs to establish permanent homes or temporary sites<br>     3. To assist in determining the relationship between Sleepers and the Talocan.    Ultimately, information gathered from Project Blueprint could be used to assist other Project teams (ideally, those under the <a href=evebrowser:http://wiki.eveonline.com/en/wiki/Arek%27Jaalan:_Sleeper_History>Sleeper History division</a>), and to help further the efforts of those in the Arek'Jaalan initiative.    <i>This abstract relates to research undertaken by the <a href=evebrowser: http://wiki.eveonline.com/en/wiki/Arek%27Jaalan>Arek'Jaalan Project.</a></i>    <i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>    <i>Further copies of this document can be obtained through the Arek'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>  "; marketGroupId= None; groupId= 1141; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
